let ADD_USER = "SET_USER"
let SET_PHOTO = 'SET_PHOTO'
let ADD_REASONS = 'ADD_REASONS'

export let addUser = (user) => {
    return (
        {
            type: ADD_USER,
            user
        }
    )
}

export let setPhoto = (photo) => {
    return (
        {
            type: SET_PHOTO,
            photo
        }
    )
}

export let addReasons = (count, name) => {
    return (
        {
            type: ADD_REASONS,
            count,
            name
        }
    )
}

let initialState = {
    users: [
        {
            name: "user",
            photo: "data:image/png;base64,",
            reason: 0,
            vk: ""
        }
    ],
    currPhoto: ''
}

const photosReducer = (state = initialState, action) => {

    switch (action.type) {
        case ADD_USER: {
            return (
                {
                    ...state,
                    users: [
                        ...state.users,
                        action.user
                    ]
                }
            )
        }
        case SET_PHOTO: {
            return (
                {
                    ...state,
                    currPhoto: action.photo
                }
            )
        }
        case ADD_REASONS: {

            let users = [...state.users]

            for (let i = 0; i < users.length; i++){

                if (users[i].name == action.name){

                    users[i].reason += action.count
                    break

                }

            }

            return(
                {
                    ...state,
                    users: [...users]
                }
            )
        }
        default: {
            return (
                { ...state }
            )
        }
    }

}

export default photosReducer